import React from "react";
import Banner from "./Banner";
import Content from "./Content";
import { ContainerDiv } from "../styledComponents";
import { getLists, getList } from "../test_list";

// import { getLists } from "../test_list";

const Test = () => {
  let listId = 1;
  // const lists = getLists();
  let list = getList(listId);

  // console.log(lists);
  // console.log(list);

  return (
    <ContainerDiv>
      <Banner></Banner>
      <Content listData={list}></Content>
      <div className="rsd">
        <p>{list.cpr}</p>
      </div>
    </ContainerDiv>
  );
};

export default Test;
